    "lower-souris-national-wildlife-refuge-narrative-report-january-february-march-april-1945",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lower Souris
    NWR outlines Refuge accomplishments from January through April of 1945. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include grazing, haying, and fur harvesting. The
    public relations section of the report describes Refuge visitors and Refuge participation.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
